class Main {
    public static void main(String[] args) {

        Solution sol = new Solution();

        long start = System.currentTimeMillis();
        pl(sol.isAnagram("anagram", "nagaram"));
        pl(sol.isAnagram("rat", "car"));
        pl(sol.isAnagram("nl", "cx"));
        pl(sol.isAnagram("nl", "cx"));
        pl(sol.isAnagram(
                "",
                ""));
        pl(sol.isAnagram(
                "",
                ""));
        Main.pl(System.currentTimeMillis() - start);
    }

    public static void pl(Object o) {
        System.out.println(o.toString());
    }
}

/* Try to sum up the values of the characters by mapping them to prime numbers. 
If the sums of the two strings are equal then they are anagrams */
class Solution {
    public boolean isAnagram(String s, String t) {
        char len = (char) s.length();
        if (len != (char) t.length()) {
            return false;
        }

        char[] count = new char[(byte) 26];

        for (char i = (byte) 0; i < len; i++) {
            count[s.charAt(i) - (byte) 97] += (byte) 1;
            count[t.charAt(i) - (byte) 97] -= (byte) 1;
        }
        for (byte i = (byte) 0; i < (byte) 26; ++i) {
            if (count[i] != (byte) 0) {
                return false;
            }
        }
        return true;
    }
}